language = model.language

if (language==="")
    language ='en'

for (i=0; i<v.length; i++){
    count_POI = flow.get("count")
    n3=""
    //---------serviceuri----------------------
    suri = v[i].Values.suri;

    //----------------Model--------------------
    subCategory = model.sub_nature;
    n3 +="<"+suri+"> a <"+km4c+subCategory+"> .\n"

    modelName = model.name
    n3 +=toN3(suri,  km4c+"model", modelName, "")
//<http://www.disit.org/km4city/resource/poi/WestGreece/Peripheral_Unit_of_Ilia_Olympia_xlsx_ARTI_GRAND> <http://www.disit.org/km4city/schema#model> "NOME_Mdello" .
    n3 += toN3_property(suri, ssn+"implements",poiTable) 
//<http://www.disit.org/km4city/resource/poi/WestGreece/Peripheral_Unit_of_Ilia_Olympia_xlsx_ARTI_GRAND> <http://www.w3.org/ns/ssn/implements> <http://www.disit.org/km4city/resource/iot/PoiTable> 


    //-----------------Instances--------------------

    identifier = v[i].Values.name.replace(' ', '_')
    n3 += toN3(suri, dcterms+"identifier", identifier, "");
    n3 += toN3(suri, schema+"name", v[i].Values.name, language);
    lat = v[i].Values.latitude
    if(lat !=="")
        n3 += "<"+suri+"> <"+geo+"lat> \""+lat+"\"^^<http://www.w3.org/2001/XMLSchema#float> .\n";
    long = v[i].Values.longitude
    if(long !=="")
        n3 += "<"+suri+"> <"+geo+"long> \""+long+"\"^^<http://www.w3.org/2001/XMLSchema#float> .\n";

    shortDesc = v[i].Values.descriptionShort
    if(shortDesc !=="")
        n3 += toN3(suri, km4c+"shortDescription", shortDesc, language);
    longDesc =  v[i].Values.descriptionLong
    if (longDesc!=="")
        n3 += toN3(suri, dcterms+"description", longDesc, language);
    abbreviation = v[i].Values.abbreviation
    if (abbreviation!=="")
        n3 += toN3(suri, km4c+"shortName", abbreviation, language);
    phone = v[i].Values.phone
    if (phone!=="")
        n3 += toN3(suri, schema+"telephone",phone , "");

    secondPhone = v[i].Values.secondPhone
    if (secondPhone!=="")   
        n3 += toN3(suri, schema+"otherTelephone",secondPhone , "");
    fax = v[i].Values.fax
    if(fax !=="")
        n3 += toN3(suri, km4c+"faxNumber", fax, "");
    secondFax = v[i].Values.secondFax
    if(secondFax!=="")
        n3 += toN3(suri, km4c+"otherFaxNumber", secondFax, "");

    url = v[i].Values.url
    if(url!=="")
        n3 += toN3(suri, schema+"url", url, "");
    email = v[i].Values.email
    if(email!=="")
        n3 += toN3(suri, schema+"email", email, "");
    secondEmail = v[i].Values.secondEmail
    if(secondEmail!=="")
        n3 += toN3(suri, km4c+"otherEmail", secondEmail, "");
    refPerson=v[i].Values.refPerson
    if(refPerson!=="")
        n3 += toN3(suri, km4c+"referencePerson", refPerson, "");

    streetAddress = v[i].Values.streetAddress    
    if(streetAddress!=="")
        n3 += toN3(suri, schema+"streetAddress", streetAddress, "");

    civicNumber = v[i].Values.civicNumber
    if(civicNumber!=="")
        n3 += toN3(suri, km4c+"houseNumber", civicNumber, "");
    postalcode = v[i].Values.postalcode
    if(postalcode!=="")
        n3 += toN3(suri, schema+"postalCode", postalcode, "");
    city=v[i].Values.city
    if(city!=="")
        n3 += toN3(suri, schema+"addressLocality", city, "");
    province = v[i].Values.province
    if(province!=="")
        n3 += toN3(suri, schema+"addressRegion", province, "");
    secondStreetAddress = v[i].Values.secondStreetAddress
    if(secondStreetAddress!=="")
        n3 += toN3(suri, km4c+"otherStreetAddress", secondStreetAddress, "");
    secondCivicNumber = v[i].Values.secondCivicNumber
